  }

  render() {
    return (
      <div>
        <div data-vjs-player className="video-container">
          <video ref={(node) => { this.videoNode = node; }} className="video-js" />
        </div>
      </div>
    );
  }
}

export default Video;

Video.propTypes = {
  src: PropTypes.string.isRequired,
  parentCallback: PropTypes.func.isRequired,
};
